import React, { useState, useEffect } from 'react';
import { useCart } from '../context/CartContext';
import PaymentOptions from './PaymentOptions';

const Cart = () => {
  const { cartItems, removeFromCart, updateQuantity, getTotalAmount } = useCart();
  const [showPaymentOptions, setShowPaymentOptions] = useState(false);
  const totalAmount = getTotalAmount();

  useEffect(() => {
    // Load Razorpay script
    const script = document.createElement('script');
    script.src = 'https://checkout.razorpay.com/v1/checkout.js';
    script.async = true;
    document.body.appendChild(script);

    return () => {
      document.body.removeChild(script);
    };
  }, []);

  return (
    <div className="max-w-6xl mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-8">Your Cart</h1>

      {cartItems.length === 0 ? (
        <div className="text-center py-8">
          <p className="text-xl text-gray-600">Your cart is empty</p>
        </div>
      ) : (
        <div className="grid grid-cols-1 gap-8">
          {/* Cart Items */}
          <div className="bg-white rounded-lg shadow-md">
            {cartItems.map((item) => (
              <div key={item.id} className="flex items-center justify-between p-4 border-b">
                <div className="flex-grow">
                  <h3 className="text-lg font-semibold">{item.name}</h3>
                  <p className="text-gray-600">₹{item.price}</p>
                  <div className="flex items-center mt-2">
                    <button 
                      className="bg-gray-200 px-3 py-1 rounded-l"
                      onClick={() => updateQuantity(item.id, item.quantity - 1)}
                    >
                      -
                    </button>
                    <span className="px-4 py-1 bg-gray-100">{item.quantity}</span>
                    <button 
                      className="bg-gray-200 px-3 py-1 rounded-r"
                      onClick={() => updateQuantity(item.id, item.quantity + 1)}
                    >
                      +
                    </button>
                  </div>
                </div>
                <div className="flex flex-col items-end ml-4">
                  <p className="font-semibold">₹{item.price * item.quantity}</p>
                  <button 
                    className="text-red-500 mt-2"
                    onClick={() => removeFromCart(item.id)}
                  >
                    Remove
                  </button>
                </div>
              </div>
            ))}
          </div>

          {/* Order Summary */}
          <div className="bg-white rounded-lg shadow-md p-6">
            <h2 className="text-xl font-semibold mb-4">Order Summary</h2>
            <div className="flex justify-between mb-2">
              <span>Subtotal</span>
              <span>₹{totalAmount}</span>
            </div>
            <div className="flex justify-between mb-2">
              <span>Delivery Fee</span>
              <span>₹40</span>
            </div>
            <div className="border-t pt-2 mt-2">
              <div className="flex justify-between font-semibold">
                <span>Total</span>
                <span>₹{totalAmount + 40}</span>
              </div>
            </div>
            <button 
              className="w-full bg-orange-500 text-white py-3 rounded-lg mt-4 hover:bg-orange-600 transition"
              onClick={() => setShowPaymentOptions(true)}
            >
              Proceed to Checkout
            </button>
          </div>
        </div>
      )}

      {showPaymentOptions && (
        <PaymentOptions
          amount={totalAmount + 40}
          onClose={() => setShowPaymentOptions(false)}
        />
      )}
    </div>
  );
};

export default Cart;
